&lt;div class=&quot;section&quot; id=&quot;profile&quot;&gt;
    &lt;div class=&quot;left-col&quot;&gt;
        &lt;h1&gt;{{ user.name }} {{ user.surname }}&lt;/h1&gt;
        &lt;p&gt;{{ user.email }}&lt;/p&gt;
        &lt;p&gt;Username: {{ user.username }}&lt;/p&gt;
        {% if user.groups %}&lt;p&gt;Group:{{ user.groups.first().name }}&lt;/p&gt;{% endif %}
    &lt;/div&gt;
    &lt;div class=&quot;right-col&quot;&gt;
        {% set config = {mode: &#039;crop&#039;, extension: &#039;auto&#039;} %}
        &lt;img src=&quot;{{ user.avatar.getThumb(260, 260, config) | slice(1) }}&quot; alt=&quot;&quot; /&gt;
    &lt;/div&gt;
    &lt;div class=&quot;clear&quot;&gt;&lt;/div&gt;
&lt;/div&gt;
&lt;div id=&quot;info&quot;&gt;
    &lt;div class=&quot;left-col&quot;&gt;
        &lt;table&gt;
            &lt;tr&gt;
                &lt;th&gt;Joined:&lt;/th&gt;
                &lt;td&gt;{{ user.created_at | date(&#039;d.m.Y H:i:s&#039;) }}&lt;/td&gt;
            &lt;/tr&gt;
            {% if user.company %}
            &lt;tr&gt;
                &lt;th&gt;Company:&lt;/th&gt;
                &lt;td&gt;{{ user.company }}&lt;/td&gt;
            &lt;/tr&gt;
            {% endif %}
            {% if user.street_addr %}
            &lt;tr&gt;
                &lt;th&gt;Street:&lt;/th&gt;
                &lt;td&gt;{{ user.street_addr }}&lt;/td&gt;
            &lt;/tr&gt;
            {% endif %}
            {% if user.city %}
            &lt;tr&gt;
                &lt;th&gt;City:&lt;/th&gt;
                &lt;td&gt;{{ user.city }}&lt;/td&gt;
            &lt;/tr&gt;
            {% endif %}
            {% if user.zip %}
            &lt;tr&gt;
                &lt;th&gt;ZIP:&lt;/th&gt;
                &lt;td&gt;{{ user.zip }}&lt;/td&gt;
            &lt;/tr&gt;
            {% endif %}
        &lt;/table&gt;
    &lt;/div&gt;
    &lt;div class=&quot;right-col&quot;&gt;
        &lt;table&gt;
            &lt;tr&gt;
                &lt;th&gt;Last seen:&lt;/th&gt;
                &lt;td&gt;{{ user.last_login | date(&#039;d.m.Y H:i:s&#039;) }}&lt;/td&gt;
            &lt;/tr&gt;
            {% if user.phone %}
            &lt;tr&gt;
                &lt;th&gt;Phone:&lt;/th&gt;
                &lt;td&gt;{{ user.phone }}&lt;/td&gt;
            &lt;/tr&gt;
            {% endif %}
            {% if user.mobile %}
            &lt;tr&gt;
                &lt;th&gt;Mobile:&lt;/th&gt;
                &lt;td&gt;{{ user.mobile }}&lt;/td&gt;
            &lt;/tr&gt;
            {% endif %}
            {% if user.state %}
            &lt;tr&gt;
                &lt;th&gt;State:&lt;/th&gt;
                &lt;td&gt;{{ user.state.name }}&lt;/td&gt;
            &lt;/tr&gt;
            {% endif %}
            {% if user.country %}
            &lt;tr&gt;
                &lt;th&gt;Country:&lt;/th&gt;
                &lt;td&gt;{{ user.country.name }}&lt;/td&gt;
            &lt;/tr&gt;
            {% endif %}
        &lt;/table&gt;
    &lt;/div&gt;
    &lt;div class=&quot;clear&quot;&gt;&lt;/div&gt;
&lt;/div&gt;

